    padding-top: 20px;
    padding-left: 25px;
	padding-right: 33px;
`

const TopContainer = styled.div`
    display: flex;
    justify-content: space-between;
    > div{
        display:'flex'
    }
`
const CourseDetails = () => {
    return (
        <Wrapper>
            <TopContainer>
                <div>
                    <img src={thumbnail} alt=""/>
                    <H2>Advanced Neurobiology</H2>
                </div>

                {/* <Flex>
                    <img src={thumbnail} alt=""/>
                    <H2>Advanced Neurobiology</H2>
                </Flex> */}
            </TopContainer>
        </Wrapper>
    );
};

export default CourseDetails;
